import { specialCharMap } from '@testing-library/user-event/dist/keyboard';
import React, { useState } from 'react'

function Header() {
    const { authStatus, login, logout } = useState();
    return (
        <div style={{
            background: 'gray', textAlign: 'center', color: 'white', padding: '10px'
        }}>
            Welcome to my app
            <br />
            login status {
                authStatus ?
                <span>offline</span>
                :
                specialCharMap
            }
        </div>
    )
}

export default Header;
